// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./ownable.sol";

contract Points is ownable {
  event NewPoint(uint256 contactId, address owner, uint256 point);
  // address public owner = msg.sender;

  struct Point {
    string CourseId;//課程ID
    string CourseName; //課程名
    string CourseClass; //開課單位
    string CourseCategory;//課程類別
    uint64 CoursePoint;//積分數
    string CourseDate;//上課日
    uint256 getDate;//獲得積分日期(blocktimestamp)
    address owner;//誰的
  }

  mapping(uint256 => address) public contactToOwner;
  mapping(address => uint256) ownerContactCount;

  Point[] public points;

  function pointsArrayLength() public view returns (uint count) {
    return points.length;
  }

  function getPoints(uint256 _index) external  {
    // require(_index < TOTAL_TICKETS && _index >= 0);
    // require(tickets[_index].owner == address(0x0));
    // require(msg.value >= tickets[_index].price);
    points[_index].owner = msg.sender;
  }

  function createPoint(address _owner, string memory CourseId, string memory CourseName, string memory CourseClass,string memory CourseCategory, uint64 CoursePoint,string memory CourseDate) public {
        points.push(Point(CourseId, CourseName, CourseClass, CourseCategory, CoursePoint, CourseDate, block.timestamp, _owner));
        uint256 id = points.length - 1;
        contactToOwner[id] = msg.sender;
        ownerContactCount[msg.sender]++;
        emit NewPoint(id, _owner, CoursePoint);
    }
  
    function getZombiesByOwner(address _owner)
        external
        view
        returns (uint256[] memory)
    {
        uint256[] memory result = new uint256[](ownerContactCount[_owner]);
        uint256 counter = 0;
        for (uint256 i = 0; i < points.length; i++) {
            if (contactToOwner[i] == _owner) {
                result[counter] = i;
                counter++;
            }
        }
        return result;
    }
  }
